import "./News.css";
import { Container, Row, Col } from "react-bootstrap";
import NavBar from "../../components/Navbar/Navbar";
import CardNews from "../../components/Card/CardNews";

function News() {
  return (
    <>
      <NavBar />
      <Container
        fluid
        style={{ backgroundImage: `url("/images/bg-img.png")` }}
        className="cover"
      >
        <Row className="justify-content-md-center">
          <Col md={9}>
            <h1 className="h1">
              Jaksa Agung Perintahkan Bentuk Tim Khusus Tangani Mafia
              Tanah-Pelabuhan
            </h1>
          </Col>
        </Row>
      </Container>
      <Container>
        <Row></Row>
      </Container>
    </>
  );
}
export default News;
